export const Info = () => {
  return (
    <section className='footer-info'>
      <p className='footer-info-text'>
        © 2023. Truòng cao đẳng FPT Polytechnic Đà Nẵng
      </p>
      <p className='footer-info-text'>
        Địa chỉ: 147 Nguyễn Thị Thập, Hoà Minh, Liên Chiểu, Đà Nẵng.
      </p>
    </section>
  );
};
